import { Link } from "react-router-dom";
import "./ShelterProfilePage.scss";

const ShelterProfilePage = () => {
    return (
        <div className="container-fluid">
            {/* <!-- <div className="row"> */}
            <div className="col-8">
                <Link to="/">
                    <h3>Find Your Furever Friend</h3>
                </Link>
                <div className="col-4">
                    <Link to="/ShelterViewMyAnimals">
                        <h6>View My Animals</h6>
                    </Link>
                </div>
            </div>
            {/* </div> --> */}
            {/* <!-- end of row 1 --> */}
            <div className="row" id="Pawsitivitea">
                <div className="col-4">
                    <h1>Pawsitivitea</h1>
                </div>
            </div>
        </div>
    );
};

export default ShelterProfilePage;
